import React, { useEffect, useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { fetchAppointmentHistory } from '../../actions/AppointmentActions'
import CustomeModal from '../CustomeModal/CustomeModal'
import './appointmenthistory.css'
import AppointmentHistoryModalContent from './AppointmentHistoryModalContent/AppointmentHistoryModalContent'

function AppoinmentHistory() {

    let [modal, setModal] = useState(false)
    let dispatch = useDispatch()

    let appointmentHistoryRedux = useSelector(state => state.appointmentHistory.appointmentHistory)



    let handleTableClick = () => {

        // dispatch(setModalRedux({
        //     name: "ApointmentHistoryModal",
        //     value: true
        // }))
        setModal(true)

    }


    useEffect(() => {

        console.log("Calling appointment history...........");
        dispatch(fetchAppointmentHistory("75917831"));

    }, [])


    console.log(appointmentHistoryRedux);

    return (
        <div className='appontment-history-container'>

            <div className="header">
                10, February, 2021 - Wednesday

                {/* <div className="filter-button">
                    <div className="icon">&nbsp;</div>
                    Filter Appointments
                </div> */}

            </div>

            <table className='appoinment-table'>
                <tr>
                    <th>Appointment ID</th>
                    <th>Time</th>
                    <th>Doctor Name</th>
                    <th>Consultation Status</th>
                    <th>Next Steps</th>
                    <th></th>
                </tr>

                <tbody>

                    {
                        appointmentHistoryRedux ?

                        
                                appointmentHistoryRedux.map((element, key) => {

                                    return (
                                        <tr>
                                            <td >{element.appointmentId}</td>
                                            <td >09 : 50pm</td>
                                            <td >{element.doctorName}</td>
                                            <td >Complete</td>
                                            <td >See again in In 5 weeks</td>
                                            <td  ><button onClick={handleTableClick} className='more-btn' >More</button></td>

                                        </tr>
                                    )

                                })


        
                            : null
                    }


                    {/* <tr>
                        <td >123456789</td>
                        <td >09 : 50pm</td>
                        <td >Dr John Doe</td>
                        <td >Complete</td>
                        <td >See again in In 5 weeks</td>
                        <td  ><button onClick={handleTableClick} className='more-btn' >More</button></td>

                    </tr>

                    <tr>
                        <td>123456789</td>
                        <td>09 : 50pm</td>
                        <td>Dr John Doe</td>
                        <td>Complete</td>
                        <td>Not adviseds</td>
                        <td><button onClick={handleTableClick} className='more-btn' >More</button></td>

                    </tr>

                    <tr>
                        <td>123456789</td>
                        <td>09 : 50pm</td>
                        <td>Dr John Doe</td>
                        <td>Not Completed</td>
                        <td>See again in In 5 weeks</td>
                        <td><button className='more-btn' >More</button></td>

                    </tr>

                    <tr>
                        <td>123456789</td>
                        <td>09 : 50pm</td>
                        <td>Dr John Doe</td>
                        <td>Complete</td>
                        <td>See again in In 5 weeks</td>
                        <td><button onClick={handleTableClick} className='more-btn' >More</button></td>

                    </tr> */}
                </tbody>
            </table>

            <div className="pagination-container">
                {/* <Pagination defaultCurrent={6} total={500} /> */}
            </div>

            <CustomeModal
                state={modal}
                setModal={setModal}
                component={<AppointmentHistoryModalContent />}
                isRight
            />

        </div>
    )
}

export default AppoinmentHistory
